import React from 'react';
import './header.css';

class Header extends React.Component<any, any> {
    render(){
        return (
<div className="topnav">
				<form className="form-inline my-2 my-lg-0">
					<input className="form-control mr-sm-2" type="text" placeholder="Search" aria-label="Search"/>
					<button className="btn btn-outline-success my-2 my-sm-0" type="submit" style={{fontSize: "15px", width: "60px"}}>Search</button>
				</form>
				

				<div className="dropdown">
					<div className="dropdown-menu">
						<a className="dropdown-item" href="#">Normal</a>
						<a className="dropdown-item active" href="#">Active</a>
						<a className="dropdown-item disabled" href="#">Disabled</a>
					</div>
				</div>
				
				
			</div>
        );
    }

}

export default Header;
